.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1581\" class=\"mw-redirect\" title=\"1581\">1581<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B5_%D1%88%D1%82%D0%B0%D1%82%D1%8B_(%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%8B)\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0435 \u0448\u0442\u0430\u0442\u044b (\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u044b)\">\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u043c\u0438 \u0448\u0442\u0430\u0442\u0430\u043c\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%BF%D1%80%D0%BE%D0%B2%D0%B8%D0%BD%D1%86%D0%B8%D0%B9\" title=\"\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u0439\">\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 \u0441\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u0439<\/a> \u0431\u044b\u043b \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u043d\u0438\u0437\u043b\u043e\u0436\u0435\u043d \u043a\u043e\u0440\u043e\u043b\u044c \u0418\u0441\u043f\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF_II_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D0%B8)\" title=\"\u0424\u0438\u043b\u0438\u043f\u043f II (\u043a\u043e\u0440\u043e\u043b\u044c \u0418\u0441\u043f\u0430\u043d\u0438\u0438)\">\u0424\u0438\u043b\u0438\u043f\u043f II<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1592\" class=\"mw-redirect\" title=\"1592\">1592<\/a>&#160;\u2014 \u0412 \u0431\u0438\u0442\u0432\u0435 \u0441 \u0433\u0443\u0433\u0435\u043d\u043e\u0442\u0430\u043c\u0438 \u043f\u043e\u0433\u0438\u0431\u0430\u0435\u0442 \u0433\u043b\u0430\u0432\u043d\u043e\u043a\u043e\u043c\u0430\u043d\u0434\u0443\u044e\u0449\u0438\u0439 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u043c\u0430\u0440\u0448\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BD%D1%82%D0%BE-%D0%91%D0%B8%D1%80%D0%BE%D0%BD,_%D0%90%D1%80%D0%BC%D0%B0%D0%BD_%D0%B4%D0%B5\" title=\"\u0413\u043e\u043d\u0442\u043e-\u0411\u0438\u0440\u043e\u043d, \u0410\u0440\u043c\u0430\u043d \u0434\u0435\">\u0410\u0440\u043c\u0430\u043d \u0434\u0435 \u0413\u043e\u043d\u0442\u043e, \u0431\u0430\u0440\u043e\u043d \u0434\u0435 \u0411\u0438\u0440\u043e\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1611\" class=\"mw-redirect\" title=\"1611\">1611<\/a>&#160;\u2014 \u0428\u0432\u0435\u0434\u0441\u043a\u043e\u0435 \u0432\u043e\u0439\u0441\u043a\u043e \u043f\u043e\u0434 \u043d\u0430\u0447\u0430\u043b\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BB%D0%B0%D0%B3%D0%B0%D1%80%D0%B4%D0%B8,_%D0%AF%D0%BA%D0%BE%D0%B1_%D0%9F%D0%BE%D0%BD%D1%82%D1%83%D1%81%D1%81%D0%BE%D0%BD\" title=\"\u0414\u0435\u043b\u0430\u0433\u0430\u0440\u0434\u0438, \u042f\u043a\u043e\u0431 \u041f\u043e\u043d\u0442\u0443\u0441\u0441\u043e\u043d\">\u042f\u043a\u043e\u0431\u0430 \u0414\u0435\u043b\u0430\u0433\u0430\u0440\u0434\u0438<\/a> \u0437\u0430\u0445\u0432\u0430\u0442\u044b\u0432\u0430\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B3%D0%BE%D1%80%D0%BE%D0%B4\" class=\"mw-redirect\" title=\"\u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\">\u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434<\/a>. \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0438\u0435 \u0431\u043e\u044f\u0440\u0435 \u043f\u043e\u0434\u043f\