410\u043b\u0435\u043a\u0441\u0435\u0439 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447<\/a> \u0441\u043e\u0437\u0432\u0430\u043b \u0431\u043e\u044f\u0440\u0441\u043a\u0443\u044e \u0434\u0443\u043c\u0443 \u0438 \u0441\u043e\u0432\u0435\u0442 \u043f\u0430\u0442\u0440\u0438\u0430\u0440\u0445\u0430 (\u00ab\u043e\u0441\u0432\u044f\u0449\u0451\u043d\u043d\u044b\u0439 \u0441\u043e\u0431\u043e\u0440\u00bb) \u0438 \u0440\u0435\u0448\u0430\u043b \u0441 \u043d\u0438\u043c\u0438, \u0447\u0442\u043e \u043d\u0430\u0434\u043e \u0441\u0434\u0435\u043b\u0430\u0442\u044c, \u0447\u0442\u043e\u0431\u044b \u0432\u043e\u0434\u0432\u043e\u0440\u0438\u0442\u044c \u043f\u043e\u0440\u044f\u0434\u043e\u043a \u0438 \u043f\u0440\u0430\u0432\u043e\u0441\u0443\u0434\u0438\u0435 \u0432 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435, \u0447\u0442\u043e\u0431\u044b \u00ab\u0432\u0441\u044f\u043a\u0438\u0445 \u0447\u0438\u043d\u043e\u0432 \u043b\u044e\u0434\u044f\u043c, \u043e\u0442 \u0431\u043e\u043b\u044c\u0448\u043e\u0433\u043e \u0434\u043e \u043c\u0435\u043d\u044c\u0448\u0435\u0433\u043e \u0447\u0438\u043d\u0443, \u0441\u0443\u0434 \u0438 \u0440\u0430\u0441\u043f\u0440\u0430\u0432\u0430 \u0431\u044b\u043b\u0430 \u0432\u043e \u0432\u0441\u044f\u043a\u0438\u0445 \u0434\u0435\u043b\u0430\u0445 \u0432\u0441\u0435\u043c \u0440\u0430\u0432\u043d\u0430\u00bb. \u0411\u043e\u044f\u0440\u0438\u043d\u0443 \u043a\u043d\u044f\u0437\u044e \u0418.&#160;\u0418.&#160;\u041e\u0434\u043e\u0435\u0432\u0441\u043a\u043e\u043c\u0443 \u0441 \u0447\u0435\u0442\u044b\u0440\u044c\u043c\u044f \u043f\u043e\u043c\u043e\u0449\u043d\u0438\u043a\u0430\u043c\u0438 \u043f\u043e\u0440\u0443\u0447\u0435\u043d\u043e \u0441\u043e\u0431\u0440\u0430\u0442\u044c \u0432\u0441\u0435 \u0441\u0442\u0430\u0440\u044b\u0435 \u0437\u0430\u043a\u043e\u043d\u044b (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%B4%D0%B5%D0%B1%D0%BD%D0%B8%D0%BA_%D0%98%D0%B2%D0%B0%D0%BD%D0%B0_IV\" title=\"\u0421\u0443\u0434\u0435\u0431\u043d\u0438\u043a \u0418\u0432\u0430\u043d\u0430 IV\">\u0421\u0443\u0434\u0435\u0431\u043d\u0438\u043a 1550 \u0433\u043e\u0434\u0430<\/a>, \u0434\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u043a \u043d\u0435\u043c\u0443 \u0443\u043a\u0430\u0437\u044b \u0438 \u0441\u0442\u0430\u0442\u044c\u0438 \u0438\u0437 \u041a\u043e\u0440\u043c\u0447\u0435\u0439 \u043a\u043d\u0438\u0433\u0438 \u0435\u0449\u0451 \u0432\u0440\u0435\u043c\u0451\u043d \u041a\u0438\u0435\u0432\u0441\u043a\u043e\u0439 \u0420\u0443\u0441\u0438), \u043f\u0440\u0438\u0432\u0435\u0441\u0442\u0438 \u0438\u0445 \u0432 \u043f\u043e\u0440\u044f\u0434\u043e\u043a \u0438 \u0441\u0438\u0441\u0442\u0435\u043c\u0443, \u0438\u0441\u043f\u0440\u0430\u0432\u0438\u0442\u044c \u0438 \u0434\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u044c \u0438\u0445 \u0438 \u0441\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u043d\u043e\u0432\u044b\u0439 \u043f\u043e\u043b\u043d\u044b\u0439 \u0441\u0432\u043e\u0434 \u0437\u0430\u043a\u043e\u043d\u043e\u0432&#160;\u2014 \u0423\u043b\u043e\u0436\u0435\u043d\u0438\u0435. \u041c\u0438\u043d\u0438\u043c\u0430\u043b\u0435\u043d \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u0441\u043e\u0441\u0442\u0430\u0432 \u043a\u043e\u043c\u0438\u0441\u0441\u0438\u0438, \u043d\u043e \u0438 \u0441\u0440\u043e\u043a, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043c\u043e\u043b\u043e\u0434\u043e\u0439 \u0446\u0430\u0440\u044c \u043e\u0442\u0432\u043e\u0434\u0438\u0442 \u043d\u0430 \u044d\u0442\u0443 \u0440\u0430\u0431\u043e\u0442\u0443, \u043f\u043e\u0432\u0435\u043b\u0435\u0432\u0430\u044f \u0443\u0436\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/11_%D1%81%D0%B5%D0%BD%D1%82%D1%8F%D0%B1%D1%80%D1%8F\" title=\"11 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u044f\">11 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u044f<\/a> \u0441\u043e\u0437\u0432\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B5%D0%BC%D1%81%D0%BA%D0%B8%D0%B5_%D1%81%D0%BE%D0%B1%D0%BE%D1%80%D1%8B\" class=\"mw-redirect\" title=\"\u0417\u0435\u043c\u0441\u043a\u0438\u0435 \u0441\u043e\u0431\u043e\u0440\u044b\">\u0417\u0435\u043c\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440<\/a> \u0434\u043b\u044f \u0440\u0430\u0441\u0441\u043c\u043e\u0442\u0440\u0435\u043d\u0438\u044f \u043f\u0440\u043e\u0435\u043a\u0442\u0430 \u0438 \u043f\u0440\u0438\u043d\u044f\u0442\u0438\u044f \u043d\u043e\u0432\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B1%D0%BE%D1%80%D0%BD%D0%BE%D0%B5_%D1%83%D0%BB%D0%BE%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_1649_%D0%B3%D0%BE%D0%B4%D0%B0\" title=\"\u0421\u043e\u0431\u043e\u0440\u043d\u043e\u0435 \u0443\u043b\u043e\u0436\u0435\u043d\u0438\u0435 1649 \u0433\u043e\u0434\u0430\">\u0423\u043b\u043e\u0436\u0435\u043d\u0438\u044f<\/a>.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1708\" class=\"mw-redirect\" title=\"1708\">1708<\/a>&#160;\u2014 \u041f\u043e \u043f\u0440\u0438\u043a\u0430\u0437\u0443 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0433\u0435\u0442\u043c\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B7%D0%B5%D0%BF%D0%B0,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0430\u0437\u0435\u043f\u0430, \u0418\u0432\u0430\u043d \u0421\u0442\u0435\u043f\u0430\u043d\u043e\u0432\u0438\u0447\">\u041c\u0430\u0437\u0435\u043f\u044b<\/a> \u0432\u043e\u0437\u043b\u0435 \u0411\u0435\u043b\u043e\u0439 \u0426\u0435\u0440\u043a\u0432\u0438 \u043a\u0430\u0437\u043d\u044f\u0442 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u043b\u043a\u043e\u0432\u043d\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%87%D1%83%D0%B1%D0%B5%D0%B9,_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B8%D0%B9_%D0%9B%D0%B5%D0%BE%D0%BD%D1%82%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041a\u043e\u0447\u0443\u0431\u0435\u0439, \u0412\u0430\u0441\u0438\u043b\u0438\u0439 \u041b\u0435\u043e\u043d\u0442\u044c\u0435\u0432\u0438\u0447\">\u0412\u0430\u0441\u0438\u043b\u0438\u044f \u041a\u043e\u0447\u0443\u0431\u0435\u044f<\/a>, \u043f\u044b\u0442\u0430\u0432\u0448\u0435\u0433\u043e\u0441\u044f \u0434\u043e\u043d\u0435\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8%D0%B9\" class=\"mw-redirect\" title=\"\u041f\u0451\u0442\u0440 I \u0412\u0435\u043b\u0438\u043a\u0438\u0439\">\u041f\u0435\u0442\u0440\u0443 I<\/a> \u043e\u0431 \u0438\u0437\u043c\u0435\u043d\u0435 \u0433\u0435\u0442\u043c\u0430\u043d\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1709\" class=\"mw-redirect\" title=\"1709\">1709<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8%D0%B9\" class=\"mw-redirect\" title=\"\u041f\u0451\u0442\u0440 I \u0412\u0435\u043b\u0438\u043a\u0438\u0439\">\u041f\u0451\u0442\u0440 I<\/a> \u0441 \u0442\u0440\u0438\u0443\u043c\u0444\u043e\u043c \u043f\u043e\u0441\u043b\u0435 \u041f\u043e\u043b\u0442\u0430\u0432\u0441\u043a\u043e\u0439 \u043f\u043e\u0431\u0435\u0434\u044b \u0432\u044a\u0435\u0437\u0436\u0430\u0435\u0442 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2\" title=\"\u041a\u0438\u0435\u0432\">\u041a\u0438\u0435\u0432<\/a>, \u0433\u0434\u0435 \u043f\u0440\u043e\u0431\u044b\u043b \u043c\u0435\u0441\u044f\u0446.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1722\" class=\"mw-redirect\" title=\"1722\">1722<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%81%D1%82%D0%BE%D0%BD\" title=\"\u0411\u043e\u0441\u0442\u043e\u043d\">\u0411\u043e\u0441\u0442\u043e\u043d\u0435<\/a> \u043e\u0431\u043d\u0430\u0440\u043e\u0434\u0443\u0435\u0442\u0441\u044f \u0434\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0438\u044f, \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u044e\u0449\