edia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D0%BB%D0%B8%D0%BD,_%D0%91%D0%B5%D0%BD%D0%B4%D0%B6%D0%B0%D0%BC%D0%B8%D0%BD\" title=\"\u0424\u0440\u0430\u043d\u043a\u043b\u0438\u043d, \u0411\u0435\u043d\u0434\u0436\u0430\u043c\u0438\u043d\">\u0411\u0435\u043d\u0434\u0436\u0430\u043c\u0438\u043d \u0424\u0440\u0430\u043d\u043a\u043b\u0438\u043d<\/a> \u043d\u0430\u0437\u043d\u0430\u0447\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BB%D0%B0%D0%B2%D0%BD%D1%8B%D0%B9_%D0%BF%D0%BE%D1%87%D1%82%D0%BC%D0%B5%D0%B9%D1%81%D1%82%D0%B5%D1%80_%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0413\u043b\u0430\u0432\u043d\u044b\u0439 \u043f\u043e\u0447\u0442\u043c\u0435\u0439\u0441\u0442\u0435\u0440 \u0421\u0428\u0410\">\u0433\u043b\u0430\u0432\u043d\u044b\u043c \u043f\u043e\u0447\u0442\u043c\u0435\u0439\u0441\u0442\u0435\u0440\u043e\u043c \u0421\u0435\u0432\u0435\u0440\u043e\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u0448\u0442\u0430\u0442\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1788\" class=\"mw-redirect\" title=\"1788\">1788<\/a>&#160;\u2014 11-\u043c \u0448\u0442\u0430\u0442\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f \u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1805\" class=\"mw-redirect\" title=\"1805\">1805<\/a>&#160;\u2014 \u0418\u0437-\u0437\u0430 \u0438\u0437\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%B7%D1%83%D0%B2%D0%B8%D0%B9\" title=\"\u0412\u0435\u0437\u0443\u0432\u0438\u0439\"