432\u0430\u043d\u0438\u0435 \u043a \u043e\u0441\u0442\u0440\u043e\u0432\u0430\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D0%97%D0%B5%D0%BC%D0%BB%D1%8F\" title=\"\u041d\u043e\u0432\u0430\u044f \u0417\u0435\u043c\u043b\u044f\">\u041d\u043e\u0432\u043e\u0439 \u0417\u0435\u043c\u043b\u0438<\/a> \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u0438 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%82%D0%BA%D0%B5,_%D0%A4%D1%91%D0%B4%D0%BE%D1%80_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041b\u0438\u0442\u043a\u0435, \u0424\u0451\u0434\u043e\u0440 \u041f\u0435\u0442\u0440\u043e\u0432\u0438\u0447\">\u0424\u0451\u0434\u043e\u0440\u0430 \u041b\u0438\u0442\u043a\u0435<\/a>. \u0411\u0440\u0438\u0433, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b\u0430\u0441\u044c \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044f, \u0442\u0430\u043a \u0438 \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0441\u044f&#160;\u2014 \u00ab\u041d\u043e\u0432\u0430\u044f \u0417\u0435\u043c\u043b\u044f\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1822\" class=\"mw-redirect\" title=\"1822\">1822<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D0%B0%D1%8F%D0%BA%D0%B8%D0%BB%D1%8C\" title=\"\u0413\u0443\u0430\u044f\u043a\u0438\u043b\u044c\">\u0413\u0443\u0430\u044f\u043a\u0438\u043b\u0435<\/a> \u0432\u0441\u0442\u0440\u0435\u0447\u0430\u044e\u0442\u0441\u044f \u043b\u0438\u0434\u0435\u0440\u044b \u043b\u0430\u0442\u0438\u043d\u043e\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u0435\u0440\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B8%D0%B2%D0%B0%D1%80,_%D0%A1%D0%B8%D0%BC%D0%BE%D0%BD\" title=\"\u0411\u043e\u043b\u0438\u0432\u0430\u0440, \u0421\u0438\u043c\u043e\u043d\">\u0421\u0438\u043c\u043e\u043d \u0411\u043e\u043b\u0438\u0432\u0430\u0440<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD-%D0%9C%D0%B0%D1%80%D1%82%D0%B8%D0%BD,_%D0%A5%D0%BE%D1%81%D0%B5_%D0%B4%D0%B5\" title=\"\u0421\u0430\u043d-\u041c\u0430\u0440\u0442\u0438\u043d, \u0425\u043e\u0441\u0435 \u0434\u0435\">\u0425\u043e\u0441\u0435 \u0434\u0435 \u0421\u0430\u043d-\u041c\u0430\u0440\u0442\u0438\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1830\" class=\"mw-redirect\" title=\"1830\">1830<\/a>&#160;\u2014 \u041a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_X_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8)\" title=\"\u041a\u0430\u0440\u043b X (\u043a\u043e\u0440\u043e\u043b\u044c \u0424\u0440\u0430\u043d\u0446\u0438\u0438)\">\u041a\u0430\u0440\u043b X<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u044b\u0432\u0430\u0435\u0442 \u0447\u0435\u0442\u044b\u0440\u0435 \u043e\u0440\u0434\u043e\u043d\u0430\u043d\u0441\u0430 (\u0443\u043a\u0430\u0437\u0430): \u043e\u0431 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0438\u0438 \u0441\u0432\u043e\u0431\u043e\u0434\u044b \u043f\u0435\u0447\u0430\u0442\u0438 \u0438 \u0432\u0432\u0435\u0434\u0435\u043d\u0438\u0438 \u0446\u0435\u043d\u0437\u0443\u0440\u044b, \u043e \u0440\u043e\u0441\u043f\u0443\u0441\u043a\u0435 \u043f\u0430\u043b\u0430\u0442\u044b \u0434\u0435\u043f\u0443\u0442\u0430\u0442\u043e\u0432 (\u0433\u0434\u0435 \u0431\u043e\u043b\u044c\u0448\u0438\u043d\u0441\u0442\u0432\u043e \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u043e\u043f\u043f\u043e\u0437\u0438\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u043b\u0438\u0431\u0435\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u0431\u0443\u0440\u0436\u0443\u0430\u0437\u0438\u044f), \u043e \u0432\u0432\u0435\u0434\u0435\u043d\u0438\u0438 \u043d\u043e\u0432\u043e\u0433\u043e \u0438\u0437\u0431\u0438\u0440\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0437\u0430\u043a\u043e\u043d\u0430 (\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0438\u0432\u0430\u044e\u0449\u0438\u043c \u0447\u0438\u0441\u043b\u043e \u0433\u0440\u0430\u0436\u0434\u0430\u043d, \u043e\u0431\u043b\u0430\u0434\u0430\u0432\u0448\u0438\u0445 \u043f\u0440\u0430\u0432\u043e\u043c \u0433\u043e\u043b\u043e\u0441\u0430, \u0437\u0435\u043c\u0435\u043b\u044c\u043d\u044b\u043c \u0446\u0435\u043d\u0437\u043e\u043c), \u0438 \u043e \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u0438 \u043d\u043e\u0432\u044b\u0445 \u0432\u044b\u0431\u043e\u0440\u043e\u0432 \u0432 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1830\" class=\"mw-redirect\" title=\"1830\">1830<\/a>. \u042d\u0442\u0438 \u0443\u043a\u0430\u0437\u044b \u0441\u0442\u0430\u043d\u0443\u0442 \u043d\u0435\u043f\u043e\u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u043f\u043e\u0432\u043e\u0434\u043e\u043c \u0434\u043b\u044f \u0418\u044e\u043b\u044c\u0441\u043a\u043e\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438, \u043f\u043e\u043b\u043e\u0436\u0438\u0432\u0448\u0435\u0439 \u043a\u043e\u043d\u0435\u0446 \u0440\u0435\u0436\u0438\u043c\u0443 \u0420\u0435\u0441\u0442\u0430\u0432\u0440\u0430\u0446\u0438\u0438 \u0438 \u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044e \u0441\u0442\u0430\u0440\u0448\u0435\u0439 \u043b\u0438\u043d\u0438\u0438 \u0434\u0438\u043d\u0430\u0441\u0442\u0438\u0438 \u0411\u0443\u0440\u0431\u043e\u043d\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1847_%D0%B3%D0%BE%D0%B4\" title=\"1847 \u0433\u043e\u0434\">1847<\/a>&#160;\u2014 \u041f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0430 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B1%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u041b\u0438\u0431\u0435\u0440\u0438\u044f\">\u041b\u0438\u0431\u0435\u0440\u0438\u044f<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u043e\u0435 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e \u0432 \u0447\u0451\u0440\u043d\u043e\u0439 \u0410\u0444\u0440\u0438\u043a\u0435. \u041e\u0442\u0446\u0430\u043c\u0438-\u043e\u0441\u043d\u043e\u0432\u0430\u0442\u0435\u043b\u044f\u043c\u0438 \u0441\u0442\u0430\u043b\u0438 \u0438\u043c\u043c\u0438\u0433\u0440\u0430\u043d\u0442\u044b&#160;\u2014 \u0432\u044b\u0432\u0435\u0437\u0435\u043d\u043d\u044b\u0435 (\u043d\u0430\u0447\u0438\u043d\u0430\u044f \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1821_%D0%B3%D0%BE%D0%B4\" title=\"1821 \u0433\u043e\u0434\">1821 \u0433\u043e\u0434\u0430<\/a>) \u0438\u0437 \u0421\u0428\u0410 \u043e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0451\u043d\u043d\u044b\u0435 \u043d\u0435\u0433\u0440\u044b, \u0437\u0430\u043d\u044f\u0432\u0448\u0438\u0435 \u0433\u043e\u0441\u043f\u043e\u0434\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u0435 \u043f\u043e\u0437\u0438\u0446\u0438\u0438 \u0432\u043e \u0432\u0441\u0435\u0445 \u0441\u0444\u0435\u0440\u0430\u0445 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1848\" class=\"mw-redirect\" title=\"1848\">1848<\/a>&#160;\u2014 \u0418\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0439 \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0430\u0432\u0430\u043d\u0442\u044e\u0440\u0438\u0441\u0442\u043a\u0435, \u043f\u0440\u043e\u043f\u043e\u0432\u0435\u0434\u043d\u0438\u0446\u0435, \u043e\u0441\u043d\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u0438\u0446\u0435 \u00ab\u0434\u0443\u0445\u043e\u0432\u043d\u043e\u0433\u043e \u0441\u043e\u044e\u0437\u0430\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D1%82%D0%B0%D1%80%D0%B8%D0%BD%D0%BE%D0%B2%D0%B0,_%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0422\u0430\u0442\u0430\u0440\u0438\u043d\u043e\u0432\u0430, \u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 \u0424\u0438\u043b\u0438\u043f\u043f\u043e\u0432\u043d\u0430\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0435 \u0422\u0430\u0442\u0430\u0440\u0438\u043d\u043e\u0432\u043e\u0439<\/a> \u043f\u043e\u0437\u0432\u043e\u043b\u044f\u0435\u0442\u0441\u044f \u0436\u0438\u0442\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043f\u043e\u0441\u043b\u0435 \u0435\u0451 \u043e\u0431\u044f\u0437\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u043f\u043e\u0434\u0447\u0438\u043d\u044f\u0442\u044c\u0441\u044f \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u043e\u0439 \u0446\u0435\u0440\u043a\u0432\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1858\" class=\"mw-redirect\" title=\"1858\">1858<\/a>&#160;\u2014 \u0411\u0430\u0440\u043e\u043d \u0420\u043e\u0442\u0448\u0438\u043b\u044c\u0434 (Lionel Nathan de Rothschild) \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u043c \u0435\u0432\u0440\u0435\u0435\u043c&#160;\u2014 \u0447\u043b\u0435\u043d\u043e\u043c \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1864\" class=\"mw-redirect\" title=\"1864\">1864<\/a>&#160;\u2014 \u041d\u043e\u0432\u044b\u0439 \u0443\u0441\u0442\u0430\u0432 \u043d\u0430\u0447\u0430\u043b\u044c\u043d\u044b\u0445 \u0448\u043a\u043e\u043b: \u0438\u0445 \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0435 \u0438 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0438\u043c\u0438 \u0434\u043e\u0432\u0435\u0440\u044f\u0435\u0442\u0441\u044f \u0437\u0435\u043c\u0441\u0442\u0432\u0430\u043c, \u0430 \u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u043a\u0430 \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0448\u043a\u043e\u043b\u044c\u043d\u044b\u043c \u0441\u043e\u0432\u0435\u0442\u043e\u043c, \u0433\u0434\u0435 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u044b \u043c\u0435\u0441\u0442\u043d\u0430\u044f \u0430\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u044f, \u0446\u0435\u0440\u043a\u043e\u0432\u044c \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B5%D0%BC%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0417\u0435\u043c\u0441\u0442\u0432\u043e\">\u0437\u0435\u043c\u0441\u0442\u0432\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1865\" class=\"mw-redirect\" title=\"1865\">1865<\/a>&#160;\u2014 \u041f\u043e\u0441\u043b\u0435 \u0441\u043c\u0435\u0440\u0442\u0438 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0434\u043e\u043a\u0442\u043e\u0440\u0430 \u0414\u0436\u0435\u0439\u043c\u0441\u0430 \u0411\u0435\u0440\u0440\u0438 \u0432\u044b\u044f\u0441\u043d\u044f\u0435\u0442\u0441\u044f, \u0447\u0442\u043e \u043d\u0430 \u043f\u0440\u043e\u0442\u044f\u0436\u0435\u043d\u0438\u0438 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u0438\u0445 \u0434\u0435\u0441\u044f\u0442\u043a\u043e\u0432 \u043b\u0435\u0442 \u043f\u043e\u0434 \u044d\u0442\u0438\u043c \u0438\u043c\u0435\u043d\u0435\u043c \u0441\u043a\u0440\u044b\u0432\u0430\u043b\u0430\u0441\u044c \u0436\u0435\u043d\u0449\u0438\u043d\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1866\" class=\"mw-redirect\" title=\"1866\">1866<\/a>&#160;\u2