\/wiki\/%D0%AD%D1%81%D0%BF%D0%B5%D1%80%D0%B0%D0%BD%D1%82%D0%BE\" title=\"\u042d\u0441\u043f\u0435\u0440\u0430\u043d\u0442\u043e\">\u044d\u0441\u043f\u0435\u0440\u0430\u043d\u0442\u043e<\/a> (\u043d\u0430 \u0440\u0443\u0441\u0441\u043a\u043e\u043c \u044f\u0437\u044b\u043a\u0435).<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1908\" class=\"mw-redirect\" title=\"1908\">1908<\/a><ul><li>\u041c\u0438\u043d\u0438\u0441\u0442\u0440 \u044e\u0441\u0442\u0438\u0446\u0438\u0438 \u0421\u0428\u0410 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82,_%D0%A7%D0%B0%D1%80%D0%BB%D0%B7_%D0%94%D0%B6%D0%BE%D0%B7%D0%B5%D1%84\" title=\"\u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442, \u0427\u0430\u0440\u043b\u0437 \u0414\u0436\u043e\u0437\u0435\u0444\">\u0427\u0430\u0440\u043b\u0437 \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442<\/a> \u0441\u043e\u0437\u0434\u0430\u0451\u0442 \u0431\u0435\u0437\u044b\u043c\u044f\u043d\u043d\u043e\u0435 \u0432\u0435\u0434\u043e\u043c\u0441\u0442\u0432\u043e, \u0441\u043f\u0435\u0446\u0430\u0433\u0435\u043d\u0442\u044b \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0434\u043e\u043b\u0436\u043d\u044b \u0431\u0443\u0434\u0443\u0442 \u0440\u0430\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u044c \u043d\u0430\u0440\u0443\u0448\u0435\u043d\u0438\u044f \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0445 \u0437\u0430\u043a\u043e\u043d\u043e\u0432. \u041f\u0435\u0440\u0432\u044b\u043c \u0435\u0433\u043e \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u0435\u043c \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BD%D1%87,_%D0%A1%D1%82%D0%B5%D0%BD%D0%BB%D0%B8_%D0%92%D0%B5%D0%BB%D0%BB%D0%B8%D0%BD%D0%B3%D1%82%D0%BE%D0%BD\" title=\"\u0424\u0438\u043d\u0447, \u0421\u0442\u0435\u043d\u043b\u0438 \u0412\u0435\u043b\u043b\u0438\u043d\u0433\u0442\u043e\u043d\">\u0421\u0442\u0435\u043d\u043b\u0438 \u0424\u0438\u043d\u0447<\/a> (Stanley Finch). \u041d\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0439 \u0433\u043e\u0434 \u043f\u043e\u044f\u0432\u0438\u0442\u0441\u044f \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435&#160;\u2014 \u0411\u044e\u0440\u043e \u0440\u0430\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u0439, \u0430 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1_%D0%B8%D1%8E%D0%BB%D1%8F\" title=\"1 \u0438\u044e\u043b\u044f\">1 \u0438\u044e\u043b\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935_%D0%B3%D0%BE%D0%B4\" title=\"1935 \u0433\u043e\u0434\">1935 \u0433\u043e\u0434\u0430<\/a> \u0432\u0435\u0434\u043e\u043c\u0441\u0442\u0432\u043e \u0441\u0442\u0430\u043d\u0435\u0442 \u043d\u0430\u0437\u044b\u0432\u0430\u0442\u044c\u0441\u044f \u0424\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u043c \u0431\u044e\u0440\u043e \u0440\u0430\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u0439 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%91%D0%A0\" class=\"mw-redirect\" title=\"\u0424\u0411\u0420\">\u0424\u0411\u0420<\/a>). \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1983_%D0%B3%D0%BE%D0%B4\" title=\"1983 \u0433\u043e\u0434\">1983 \u0433\u043e\u0434\u0443<\/a> \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0428\u0410 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D0%B3%D0%B0%D0%BD,_%D0%A0%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%B4\" title=\"\u0420\u0435\u0439\u0433\u0430\u043d, \u0420\u043e\u043d\u0430\u043b\u044c\u0434\">\u0420\u043e\u043d\u0430\u043b\u044c\u0434 \u0420\u0435\u0439\u0433\u0430\u043d<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u0442 \u043e\u0431 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0438 \u00ab\u0414\u043d\u044f \u0424\u0411\u0420\u00bb&#160;\u2014 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u0440\u0430\u0437\u0434\u043d\u0438\u043a\u0430 \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u043e\u0432 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043f\u043e\u043b\u0438\u0446\u0438\u0438.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u0444\u0438\u043d\u0438\u0448\u0438\u0440\u0443\u044e\u0442 \u043f\u0435\u0440\u0432\u044b\u0435 \u043a\u0440\u0443\u0433\u043e\u0441\u0432\u0435\u0442\u043d\u044b\u0435 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c\u043d\u044b\u0435 \u0433\u043e\u043d\u043a\u0438, \u0441\u0442\u0430\u0440\u0442 \u043a\u043e\u0442\u043e\u0440\u044b\u043c \u0431\u044b\u043b \u0434\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/12_%D1%84%D0%B5%D0%B2%D1%80%D0%B0%D0%BB%D1%8F\" title=\"12 \u0444\u0435\u0432\u0440\u0430\u043b\u044f\">12 \u0444\u0435\u0432\u0440\u0430\u043b\u044f<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a>. \u041f\u0435\u0440\u0432\u044b\u043c \u043a \u0444\u0438\u043d\u0438\u0448\u0443 \u043f\u0440\u0438\u0445\u043e\u0434\u0438\u0442 \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0439 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c \u00abProtos\u00bb \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Siemens-Schuckertwerke\" title=\"Siemens-Schuckertwerke\">Siemens-Schuckertwerke<\/a> GmbH, \u043a\u043e\u0442\u043e\u0440\u044b\u043c \u0443\u043f\u0440\u0430\u0432\u043b\u044f\u0435\u0442 \u043b\u0435\u0439\u0442\u0435\u043d\u0430\u043d\u0442 \u041a\u0451\u043f\u043f\u0435\u043d, \u043d\u043e \u043f\u043e\u0431\u0435\u0434\u0438\u0442\u0435\u043b\u0435\u043c \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0435\u0446 \u0414\u0436\u043e\u0440\u0434\u0436 \u0428\u0443\u0441\u0442\u0451\u0440 \u043d\u0430 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u0435 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0442\u043e\u0440\u0430 \u0422\u043e\u043c\u0430\u0441\u0430. \u041d\u0435\u043c\u0435\u0446\u043a\u043e\u0433\u043e \u0433\u043e\u043d\u0449\u0438\u043a\u0430 \u043e\u0448\u0442\u0440\u0430\u0444\u043e\u0432\u0430\u043b\u0438 \u043d\u0430 15 \u0434\u043d\u0435\u0439, \u0442\u0430\u043a \u043a\u0430\u043a \u043f\u043e\u0441\u043b\u0435 \u043f\u043e\u043b\u043e\u043c\u043a\u0438 \u0435\u0433\u043e \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c \u0431\u044b\u043b \u0434\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d \u0432 \u0421\u0438\u044d\u0442\u043b \u043f\u043e \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0439 \u0434\u043e\u0440\u043e\u0433\u0435, \u0447\u0442\u043e\u0431\u044b \u043e\u0442\u043f\u043b\u044b\u0442\u044c \u0432 \u0420\u043e\u0441\u0441\u0438\u044e \u0432\u043c\u0435\u0441\u0442\u0435 \u0441 \u043a\u043e\u043d\u043a\u0443\u0440\u0435\u043d\u0442\u0430\u043c\u0438. \u041b\u0435\u0439\u0442\u0435\u043d\u0430\u043d\u0442\u0443 \u043d\u0435 \u043e\u0441\u0442\u0430\u0451\u0442\u0441\u044f \u043d\u0438\u0447\u0435\u0433\u043e \u0438\u043d\u043e\u0433\u043e, \u043a\u0430\u043a \u0437\u0430\u044f\u0432\u0438\u0442\u044c: \u00ab\u042f \u0445\u043e\u0442\u0435\u043b \u0431\u044b, \u0447\u0442\u043e\u0431\u044b \u0434\u043e\u0440\u043e\u0433\u0438 \u0432 \u0410\u043c\u0435\u0440\u0438\u043a\u0435 \u0431\u044b\u043b\u0438 \u0441\u0442\u043e\u043b\u044c \u0436\u0435 \u043f\u0440\u0435\u043a\u0440\u0430\u0441\u043d\u044b, \u043a\u0430\u043a \u0438 \u0435\u0451 \u043b\u044e\u0434\u0438\u00bb. \u0418\u0441\u0442\u043e\u0440\u0438\u044f \u044d\u0442\u0438\u0445 \u0433\u043e\u043d\u043e\u043a \u043f\u043e\u0441\u043b\u0443\u0436\u0438\u0442 \u043e\u0441\u043d\u043e\u0432\u043e\u0439 \u0441\u0446\u0435\u043d\u0430\u0440\u0438\u044f \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u043e\u0439 \u0438 \u043b\u044e\u0431\u0438\u043c\u043e\u0439 \u043c\u043d\u043e\u0433\u0438\u043c\u0438 \u043a\u0438\u043d\u043e\u043a\u043e\u043c\u0435\u0434\u0438\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%B8%D0%B5_%D0%B3%D0%BE%D0%BD%D0%BA%D0%B8_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC)\" title=\"\u0411\u043e\u043b\u044c\u0448\u0438\u0435 \u0433\u043e\u043d\u043a\u0438 (\u0444\u0438\u043b\u044c\u043c)\">\u0411\u043e\u043b\u044c\u0448\u0438\u0435 \u0433\u043e\u043d\u043a\u0438<\/a>\u00bb.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1909\" class=\"mw-redirect\" title=\"1909\">1909<\/a><ul><li>\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043a\u0438\u0439 \u043f\u0430\u0440\u043e\u0445\u043e\u0434 Waratah, \u0438\u043c\u0435\u044f \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043e\u043a\u043e\u043b\u043e 300 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u043e\u0432 \u0438 \u043a\u043e\u043c\u0430\u043d\u0434\u044b, \u0432\u044b\u0445\u043e\u0434\u0438\u0442 \u0438\u0437 \u043f\u043e\u0440\u0442\u0430 \u041d\u0430\u0442\u0430\u043b \u0432 \u042e\u0436\u043d\u043e\u0439 \u0410\u0444\u0440\u0438\u043a\u0435 \u0438 \u043f\u0440\u043e\u043f\u0430\u0434\u0430\u0435\u0442 \u0431\u0435\u0437 \u0432\u0435\u0441\u0442\u0438.<\/li><li>\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%80%D1%81%D0%B5%D0%BB%D0%BE%D0%BD%D0%B0\" title=\"\u0411\u0430\u0440\u0441\u0435\u043b\u043e\u043d\u0430\">\u0411\u0430\u0440\u0441\u0435\u043b\u043e\u043d\u0435<\/a> (\u00ab\u041a\u0440\u043e\u0432\u0430\u0432\u0430\u044f \u043d\u0435\u0434\u0435\u043b\u044f\u00bb; \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/31_%D0%B8%D1%8E%D0%BB%D1%8F\" title=\"31 \u0438\u044e\u043b\u044f\">31 \u0438\u044e\u043b\u044f<\/a>).<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911\" class=\"mw-redirect\" title=\"1911\">1911<\/a>&#160;\u2014 \u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D1%84%D1%82,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC\" class=\"mw-redirect\" title=\"\u0422\u0430\u0444\u0442, \u0423\u0438\u043b\u044c\u044f\u043c\">\u0423\u0438\u043b\u044c\u044f\u043c \u0422\u0430\u0444\u0442<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u044b\u0432\u0430\u0435\u0442 \u0414\u043e\u0433\u043e\u0432\u043e\u0440 \u043e\u0431 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f\u0445 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u043e\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1912\" class=\"mw-redirect\" title=\"1912\">1912<\/a>&#160;\u2014 \u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0435 \u0444\u0435\u043c\u0438\u043d\u0438\u0441\u0442\u043a\u0438 \u043f\u043e\u0434\u0436\u0438\u0433\u0430\u044e\u0442 \u0434\u043e\u043c \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430 \u043a\u043e\u043b\u043e\u043d\u0438\u0439 \u0411\u0440\u0438\u0442\u0430\u043d\u0438\u0438 \u0432 \u041e\u043a\u0441\u0444\u043e\u0440\u0434\u0448\u0438\u0440\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1913\" class=\"mw-redirect\" title=\"1913\">1913<\/a>&#160;\u2014 \u0410\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0430\u043d\u043d\u0443\u043b\u0438\u0440\u0443\u0435\u0442 \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B3%D0%B5%D0%BC%D0%B8%D1%8F\" title=\"\u0411\u04